import Pixy from '../components/Pixy'
import React from 'react'
export default class MainPage extends React.Component {
    render() {
        return (
            <div>
                <pageHeader>•~•~•~•~•~•~•~•~•~ Lunacats ~•~•~•~•~•~•~•~•~•</pageHeader>
                <style jsx>{`
                    html, body {
                        margin: 0;
                        width: 100%;
                        height: 100%;
                    }
                    div {
                        height: 8%;
                        width: 100%;
                    background-image: linear-gradient(to left, rgba(71, 68, 68, 0), rgba(71, 68, 68, 1));
                    border-bottom: solid rgb(15, 15, 26) 1px;
                    box-shadow: 0px 0px 5px #8888888c;
                    text-align: center;
                }
                pageHeader {
                    color: black;
                    font-size: 250%;
                }
            `}</style>
            <Pixy/>
            </div>
            

        )
    }
}
